import Fetch from 'isomorphic-unfetch';
import Navbar from '../components/Navbar';

const Index = () => {
    return (
        <div className="mainDiv">
            <Navbar />
            <h1>This is the story of my life</h1>
            <div>I hope you like it</div>
        </div>
    );
};

export default Index;
